import React from "react";
import "./snake1.css";

const Snake = ({ start, end, img }) => {
  const cellSize = 64;
  const startX = ((start - 1) % 10) * cellSize;
  const startY = Math.floor((start - 1) / 10) * cellSize - cellSize;
  const endX = ((end - 1) % 10) * cellSize;
  const endY = Math.floor((end - 1) / 10) * cellSize - cellSize;
  const width = Math.abs(endX - startX) + cellSize;
  const height = cellSize;
  const style = {
    left: Math.min(startX, endX),
    bottom: startY,
    width,
    height,
  };
  return (
    <>
      <div className="snake" style={style}>
        <img src={img} />
        <div className="snake1" start={24} end={2}>
          <img src={require("./snake3.png")} alt="snake1" srcset="" />
        </div>
        <div className="snake2" start={35} end={18}>
          <img src={require("./snake2.png")} alt="snake1" srcset="" />
        </div>
        <div className="snake1" start={62} end={46}>
          <img src={require("./snake3.png")} alt="snake1" srcset="" />
        </div>
        <div className="snake1" start={82} end={69}>
          <img src={require("./snake3.png")} alt="snake1" srcset="" />
        </div>
      </div>
      <div className="snake1" start={92} end={88}>
        <img src={require("./snake3.png")} alt="snake1" srcset="" />
      </div>
      <div className="snake1" start={97} end={78}>
        <img src={require("./snake3.png")} alt="snake1" srcset="" />
      </div>

      {/* <img className='snake1' src={img} />
    <img className='snake1' src={img} />
    <img className='snake1' src={img} /><Snake start={47} end={32} />
        <Snake start={62} end={46} />
